import React from 'react';

const NavBar = () => {
    return (
        <div>
            <div className="ui secondary pointing menu">
                <a className="item">
                    Home
                </a>
                <a className="item">
                    Messages
                </a>
                <a className="item active">
                    Friends
                </a>
                <div className="right menu">
                    <a className="ui item">
                        Logout
                    </a>
                </div>
            </div>

        </div>
    );
};

export default NavBar;
